Sats Names (a.k.a. .sats addresses) is a standard for writing names to Bitcoin using ordinals. Addresses can be between 1 and 19 characters long, and use characters a-z, 0-9, -, and _ Before minting a Sats address, use a site such as UniSat to search to make sure the address has not already been minted Go to UniSat , Gamma or any preferred inscription service to mint a text ordinal with a JSON string as shown below {
"p": "sns",
"op": "reg",
"name": "helloworld.sats"
} Reference: About Sats Names
